export const TableRow = ({ entry }) => {

    return (
        <tr key={entry.Adres}>
            <td>{entry.Bedrijfsnaam}</td>
            <td>{entry.Adres}</td>
            <td>{entry.Postcode}</td>
            <td>{entry.marketPrice}</td>
            <td>{entry.Woonplaats}</td>
            <td>{entry.Website}</td>

        </tr>
    )
}
